INSERT INTO `questions` VALUES (1,'Did you join this program with a clear goal?','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(2,'The curriculum satisfied your expectations with respect to applying the knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the professional engineering practice.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(3,'Curriculum design was holistic with an optimum combination of basic sciences, mechanical engineering, industrial engineering, quantitative models, humanities & management, information system design, lab components and projects.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(4,'Coverage of the laboratory component in each of the courses in the curriculum demonstrates the knowledge and need for sustainable development.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(5,'Electives offered helped us effectively specialize enough in the area of interest and provided optimum choice among the electives.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(6,'Curriculum encourages industry-institute interaction, Industry visits, Internship, expert lectures and projects.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(7,'Curriculum allows you to participate in extracurricular activities (Technical events, Seminars, conferences etc.,).','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(8,'The knowledge acquired during the program is sufficient-enough to design, conduct experiments, analyze & interpret the results.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(9,'Program encourages committing to quality, timeliness and continuous improvement by creating, selecting, applying appropriate techniques, resources, modern engineering, IT tools including prediction and modelling to complex engineering activities within the framework.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(10,'Curriculum provides the adequate exposure to diversity, social, global issues and innovation to function effectively as an individual and as a member or leader in diverse teams.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(11,'The program provides knowledge and understanding of the engineering and management principles and apply these to one\'s own work, as a member and leader in a team, to manage projects.','Strongly agree','Agree','Partially agree','Mutual','Disagree'),(12,'Program has provided me enough confidence to take up professional challenges to Communicate effectively on complex engineering activities with the engineering community to be able to comprehend and write effective reports and design documentation, make effective presentations, and give and receive clear instructions.','Strongly agree','Agree','Partially agree','Mutual','Disagree');
